create table region (
	region_id INT PRIMARY KEY,
	region VARCHAR(500) NOT NULL,
    city VARCHAR(100) NOT NULL,
    country VARCHAR(100) NOT NULL,
    postal_code INT(5) NOT NULL
);


create table bank (
    bank_id INT PRIMARY KEY,
    branch_name VARCHAR(100) NOT NULL,
    region_id INT,
    FOREIGN KEY (region_id)
    REFERENCES region(region_id)
    ON DELETE CASCADE
    ON UPDATE CASCADE
);

create table if not exists user(
    user_id INT PRIMARY KEY AUTO_INCREMENT,
    username VARCHAR(50) UNIQUE NOT NULL,
    password VARCHAR(100) NOT NULL,
    email VARCHAR(100) NOT NULL,
    fullname VARCHAR(100) NOT NULL,
    birthdate DATE NOT NULL,
    gender ENUM('Male', 'Female') NOT NULL,
    roles VARCHAR(50)
);

create table if not exists account (
	account_id INT PRIMARY KEY AUTO_INCREMENT,
	user_id INT,
	account_number VARCHAR(16) UNIQUE NOT NULL,
	security_code VARCHAR(100),
	bank_id INT,
	amount DECIMAL(15,2),
    FOREIGN KEY (bank_id)
    REFERENCES bank(bank_id)
    ON DELETE CASCADE
    ON UPDATE CASCADE
);

create table orderlist (
    orderlist_id INT PRIMARY KEY,
    account_id INT,
    order_date datetime NOT NULL,
    deadline_date datetime NOT NULL,
    FOREIGN KEY (account_id)
    REFERENCES account(account_id)
    ON DELETE CASCADE
    ON UPDATE CASCADE
);


create table user(
    user_id INT PRIMARY KEY,
    username VARCHAR(50) UNIQUE NOT NULL,
    password VARCHAR(100) UNIQUE NOT NULL,
    email VARCHAR(100) UNIQUE NOT NULL,
    fullname VARCHAR(100) NOT NULL,
    birthdate DATE,
    gender ENUM('Male', 'Female')
);

create table admin(
    admin_id INT PRIMARY KEY,
    profile_photo_url VARCHAR(50),
    FOREIGN KEY (admin_id)
    REFERENCES user(user_id)
    ON DELETE CASCADE
    ON UPDATE CASCADE
);

create table member(
    member_id INT PRIMARY KEY,
    account_id INT NOT NULL,
    region_id INT NOT NULL,
    profile_photo_url VARCHAR(50),
    FOREIGN KEY (member_id)
    REFERENCES user(user_id)
    ON DELETE CASCADE
    ON UPDATE CASCADE,
    FOREIGN KEY (account_id)
    REFERENCES account(account_id)
    ON DELETE CASCADE
    ON UPDATE CASCADE,
    FOREIGN KEY (region_id)
    REFERENCES region(region_id)
);

create table guest(
    guest_id INT PRIMARY KEY,
    account_id INT,
    region_id INT,
    profile_photo_url VARCHAR(50),
    FOREIGN KEY (guest_id)
    REFERENCES user(user_id)
    ON DELETE CASCADE
    ON UPDATE CASCADE,
    FOREIGN KEY (account_id)
    REFERENCES account(account_id)
    ON DELETE SET NULL,
    FOREIGN KEY (region_id)
    REFERENCES region(region_id)
    ON DELETE SET NULL
);

create table task(
    task_date DATE,
    task_id INT,
    task_name VARCHAR(100),
    description TEXT,
    PRIMARY KEY (task_date, task_id)
);

create table activity(
    activity_date DATE,
    task_id INT, 
    member_id INT,
    time_completed datetime NOT NULL,
    PRIMARY KEY(activity_date, task_id, member_id),
    FOREIGN KEY (member_id)
    REFERENCES member(member_id)
    ON DELETE CASCADE
    ON UPDATE CASCADE,
    FOREIGN KEY (activity_date, task_id)
    REFERENCES task(task_date, task_id)
    ON DELETE CASCADE
    ON UPDATE CASCADE
);


create table withdrawal(
    admin_id INT PRIMARY KEY,
    amount INT NOT NULL,
    FOREIGN KEY (admin_id)
    REFERENCES admin(admin_id)
);






